import React from 'react'

const CategoryCard = (props) => {
    return (
        <div className="category-card">
          <div className="item">
             <img src={props.image} alt=""></img>
             <p>{props.name}</p>
          </div>
          <div className="price">
            {props.price}
          </div>
        </div>
      )
}

export default CategoryCard
